from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub()
left = Motor(Port.A, Direction.COUNTERCLOCKWISE)
right = Motor(Port.B, Direction.CLOCKWISE)
front = Motor(Port.E, Direction.CLOCKWISE)
top = Motor(Port.F, Direction.COUNTERCLOCKWISE)
drive_base_2 = DriveBase(left, right, 81, 99)

# Initialize variables.
heading = 0

async def subtask():
    await drive_base_2.turn(30)
    await drive_base_2.straight(-340)
    await drive_base_2.turn(-29.5)

async def main():
    drive_base_2.use_gyro(True)
    await multitask(front.run_angle(200, 91), subtask())
    await drive_base_2.straight(-420)
    await front.run_angle(999, 60)
    await front.run_angle(999, -100)
    await front.run_angle(100, 100)
    await front.run_angle(500, -75)
    await drive_base_2.straight(100)
    await front.run_angle(500, 75)
    await front.run_angle(500, -135)
    await drive_base_2.straight(-30)
    await front.run_angle(500, 75)
    front.control.limits(torque=450)
    drive_base_2.settings(straight_speed=550)
    await drive_base_2.curve(180, -90)
    await drive_base_2.straight(90)
    drive_base_2.settings(straight_speed=250)
    await drive_base_2.straight(-150)
    drive_base_2.settings(straight_speed=550)
    drive_base_2.settings(turn_rate=150)
    await drive_base_2.curve(-150, 90)
    await drive_base_2.straight(-350)


run_task(main())